    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This LEX Legacy Dependencies Pack includes the Mega Prop Packs of bixel, paulvmontfort, and dmscopio (also an NHP member), which had been available on the Lot Exchange (LEX) at SC4 Devotion, most of which were produced between 2007 and 2009. \_After battling a number of technical issues, software incompatibility ultimately shuttered the LEX in June 2023, and this package is designed to collect these dependencies in an easy-to-use form, allowing users to install them all in one \_go, or carefully select exactly which packs they wish to install.</p>\r\n<p>Please note that this pack is expected to receive updates in the near future. \_Do not redistribute without asking first, mostly as doing so would complicate efforts to properly maintain, update, and provide technical support for the pack.</p>\r\n<p>\_<br>This package has been made possible by the Project ZIP efforts of Tyberius06, and was assembled by Tarkus.\_ Original repackaging for the LEX releases was done by members of the BSC (BarbyW, RippleJet, et al.)</p>\r\n<p>\_<br>\_---------------------------------------------------------------------------------------------<br>\_Users download, install, and run this software completely and solely<br>\_at their own risk. Maxis, Electronic Arts, the creators, and its\_<br>\_individual contributors are not responsible for any errors, crashes,<br>\_problems, or any other issue that you may have if you have downloaded\_<br>\_and applied this software to your game. Players should also expect<br>\_that any future patches and/or expansion packs and SimCityscape may not<br>\_function properly with the game if you have downloaded this \_software and<br>\_applied it to your game. The use of this software, the information<br>\_within, and this SC4 Devotion LEX LEGACY Pack is conditional upon the acceptance of<br>\_this disclaimer and all that is within this software.<br>\_---------------------------------------------------------------------------------------------</p>\r\n<p>CONTENTS</p>\r\n<p>This package contains the following Dependency Packs:</p>\r\n<h4>MEGA Prop Packs</h4>\r\n<ul>\r\n<li>HKABT bixel MEGA Props Vol 01</li>\r\n<li>HKABT bixel MEGA Props Vol 02</li>\r\n<li>HKABT bixel MEGA Props Vol 03</li>\r\n<li>HKABT bixel MEGA Props Vol 04</li>\r\n<li>HKABT bixel MEGA Props Vol 05</li>\r\n<li>HKABT bixel MEGA Props Vol 06</li>\r\n<li>HKABT bixel MEGA Props Vol 07</li>\r\n<li>HKABT bixel MEGA Props Vol 08</li>\r\n<li>HKABT bixel MEGA Props Vol 09</li>\r\n<li>HKABT bixel MEGA Props Vol 10</li>\r\n<li>HKABT bixel MEGA Props Vol 11</li>\r\n<li>HKABT bixel MEGA Props Vol 12</li>\r\n<li>HKABT bixel MEGA Props Vol 13</li>\r\n<li>HKABT bixel MEGA Props Vol 14</li>\r\n<li>HKABT bixel MEGA Props Vol 15</li>\r\n<li>HKABT bixel MEGA Props Vol 16</li>\r\n<li>HKABT bixel MEGA Props Vol 17</li>\r\n<li>HKABT bixel MEGA Props Vol 18</li>\r\n<li>HKABT bixel MEGA Props Vol 19</li>\r\n<li>HKABT bixel MEGA Props Vol 20</li>\r\n<li>HKABT bixel MEGA Props Vol 21</li>\r\n<li>HKABT bixel MEGA Props Vol 22</li>\r\n<li>HKABT bixel MEGA Props Vol 23</li>\r\n<li>HKABT bixel MEGA Props Vol 24</li>\r\n<li>HKABT bixel MEGA Props Vol 01</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 01</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 02</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 03</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 04</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 05</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 06</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 07</li>\r\n<li>paulvmontfort MEGA Prop Pack Vol 08</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 1</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 2</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 3</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 4</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 5</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 6</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 7</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 8</li>\r\n<li>HKABT-NHP Dmscopio MEGA Prop Pack Vol 9</li>\r\n</ul>\r\n<p>Various pieces of original documentation and earlier Cleanitol definitions can be found in the \"~Documents\" folder, which, while installed in the Plugins directory, should be removed.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
