    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This extensive set of playground props has been created by Sam Johnson for using on his Moscow pre-fab lots, but they can be used on any (preferrably R-ยง) residential lots and playgrounds. All props are available in prop families with different colors, so no lot looks the same. Most of them were modeled after real-life playgrounds in Eastern Europe.</p>\r\n<p>This prop pack contains about 100 different playground props. The props are intended for usage on playgrounds and other residential lots for SimCity 4. The pack only serves as a dependency, there are no lot or similar included. If you like to see those props in your game, you will have to install corresponding lots, or create your own. In the Lot Editor, all props are listed with the prefix \"SFBT_Spielplatzprop_...\", so they are neatly grouped for easier finding. The props are grouped into families, since each prop is available in various colors.</p>\r\n<p class=\"text_zwischentitel\"><strong>Installation</strong>: Copy/extract the\_<strong>SFBT\_</strong>parent folder into your plugins folder. If you extracted the\_<em>_Documents\_</em>folders too, you don't need to keep it in your Plugins, but it is recommended to move it to a safe location for later use.\_</p>\r\n<p class=\"text_zwischentitel\"><strong>Uninstallation</strong>:\_For uninstalling the files, simply delete the files from the plugins folder.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Spielplatzprops_01.jpg\" data-lightbox=\"lightbox122\" data-alt=\"lightboxSpielplatzprops_01.jpg|Spielplatzprops_02\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshot