    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>The SFBT Essentials contain the custom UIs that every SFBT lot uses, as well as shared textures and prop packs. The file will be updated from time to time, so please check back to this download once in a while.</p>\r\n<p>SFBT Essentials</p>\r\n<ul>\r\n<li>Includes contents directly installable by .zip, and the original installer in the _DOCUMENTS folder.</li>\r\n</ul>\r\n<p>!!!!!!!!!!!!!!!!!----IMPORTANT----!!!!!!!!!!!!!!!!</p>\r\n<p><br>The <strong>SFBT Essentials 2015</strong> contains the installer due to the choosable tree replacement option on several lots. The main folder contains only the main files of the Essentials by default. If you install the SFBT Essentials manually, then you should check in the <em>_DocumentsSFBT_ReadMe</em> and from the <strong>_Trees Replacement</strong> folder copy the choosen files (<span style=\"color: #e03e2d;\"><strong>after you read the readme about how to handle them</strong></span>) into the main folder of the Essentials.\_<br>You will also find the installer in the <em>_Documents_INSTALLER</em> folder.\_</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
