    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>Contains the popular Parking Lot texture dependency by WalkingSnake (previously sc4jeeks).\_ From the author:</p>\r\n<p>These textures were previously known under my old name, <strong>Sc4jeeks</strong>. By the help of BSC they have been updated to remedy the texture conflict reported on them.</p>\r\n<p>These textures are also known as <strong>WalkingSnake Textures</strong>.\_ If you have used the old Sc4jeeks version, be sure to run Cleanitol with the enclosed file to remove the following outdatedfiles:</p>\r\n<ul>\r\n<li>plottextures0.dat</li>\r\n<li>plottextures2.dat</li>\r\n<li>plottextures3.dat</li>\r\n<li>plottextures4.dat</li>\r\n<li>plottextures5.dat</li>\r\n<li>plottextures7.dat</li>\r\n<li>plottextures9.dat</li>\r\n<li>sc4jeeks_textures.dat</li>\r\n</ul> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/WS Textures.jpg\" data-lightbox=\"lightbox131\" data-alt=\"lightboxWS Textures\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/WS Textures.jpg\" alt=\"WS Textures\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
