    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This SC4 Devotion LEX Legacy Pack features the BSC-assembled prop packs of popular Japanese BATer ks_jpn, which had been available on the Lot Exchange (LEX) at SC4 Devotion. After battling a number of technical issues, software incompatibility ultimately shuttered the LEX (at least in its familiar form from 2007 onward) in June 2023, and this package is designed to collect these dependencies in an easy-to-use form, allowing users to install them all in one go, or carefully select exactly which packs they wish to install.</p>\r\n<p>Please note that this pack <strong>is</strong> expected to receive updates in the near future. Do not redistribute without asking first, mostly as doing so would complicate efforts to properly maintain, update, and provide technical support for the pack.</p>\r\n<div class=\"bannerfull\">\r\n<p><strong><span style=\"font-size: 24px;\">CHANGE LOG</span></strong></p>\r\n</div>\r\n<div class=\"regtext\">\r\n<ul>\r\n<li>20.01.2024 - Update to Version 2</li>\r\n<ul>\r\n<li>Official update in the installer itself</li>\r\n</ul>\r\n<ul>\r\n<li>Some small adjustments and clean-ups in the prop packs and within the upload</li>\r\n<li>ks_jpn MEGA Props Vol04 has been updated to v2 as the Jade Hotel model had to be pulled out. That model is not a ks_JPN creation (as it turned out recently), but it is Raika's (another Japanese BATter) creation that was released almost 20 years ago with the Freyman Hotel upload. The said model is/will be available in the SC4D LEX Legacy - Raika Dependency Collection V1, shortly.</li>\r\n<li>ks_jpn MEGA Props Vol11 has been updated to v2 after it received a recently recovered model; the Christmas version of the Akasaka Prince Hotel</li>\r\n<li>ks_jpn MEGA Props Vol14 has been updated to v2 after the included LTUArena-001_text.dat had to be updated as the the texture inside the DAT used a dummy and conflicting ID based on the provided test range by the SC4Tool. The corresponding lot will be updated with the new texture ID.</li>\r\n</ul>\r\n</ul>\r\n</div>\r\n<p><span style=\"font-size: 24px;\"><strong>Installation</strong></span></p>\r\n<p>This package utilizes a Java-based installer (similar to the one used with the Network Addon Mod), and can also be opened and installed manually using 7-Zip or Keka.</p>\r\n<p>To install it, you'll either need the Java Runtime Environment to run the installer--<a href=\"https://adoptium.net/temurin/releases\">Adoptium's open-source edition is recommended</a>--or a zip tool capable of opening the installer to allow manual installation. For Windows/Linux, use <a href=\"https://www.7-zip.org\">7-zip</a>, and for macOS, use <a href=\"https://www.keka.io/en/\">Keka</a>.</p>\r\n<p>Once into the installer, after agreeing to the terms for the package, click to the Files tab to select which dependencies you wish to install (making no changes here will install everything). Then, click to the Location tab to set up an installation location (this should be the root of your My DocumentsSimCity 4Plugins folder).\_On the Cleanup tab, click \"Start scan\" to find any outdated files that currently reside in your Plugins folder that may conflict with this package. Clicking \"Backup\" will remove these old files to a safe location. (The option to \"Delete\" them also exists, but is not recommended.)<span style=\"color: #ba372a;\">**</span>\_After this, click over to the Install tab, and click \"Start installation\" to begin the installation procedure. When installation is complete, the tab pop up a message indicating it, after which you are safe to close the installer.</p>\r\n<p><span style=\"color: #ba372a;\">**\_Though there is an inbuilt cleanitol function in the installer, at this point it is not working entirely properly so it is highly recommended to run the individual cleanitol files or the master cleanitol for the compilation with one of the following 3rd party cleanitol tools</span>:</p>\r\n<p><a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\">nos.17 Cleanitol</a> (new tool)</p>\r\n<p><a href=\"/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\"><abbr title=\"BATT Squad Certification\">BSC</abbr>\_Cleanitol</a> (old tool)</p>\r\n<p><strong><span style=\"font-size: 24px;\">Credits</span></strong></p>\r\n<p>The following members contributed models to this collection:</p>\r\n<ul>\r\n<li>ks_jpn</li>\r\n</ul>\r\n<p>This package has been made possible by the Project ZIP efforts of Tyberius06, and was assembled by Tarkus. Previous Prop Pack assembly performed by members of the BSC.</p>\r\n<h5 class=\"leftheading\"><span style=\"font-size: 18px;\">Special Thanks</span></h5>\r\n<p>Webmaster &amp; administration staff at SC4 Devotion and SC4Evermore.</p>\r\n<p>And possibly others who may not have been mentioned. If your name has been forgotten or you're not on the list, then drop us a line, as it has been difficult to keep track of anyone/everyone that may of helped somewhere along the lines.</p>\r\n<p>And to the community itself, we would also like to thank you for your support, making mods such as this possible too. We're still at it after <strong>20 years</strong> thanks to you!</p>\r\n<p>And last but not least, a thanks for the Maxis individuals too, for the [paid] work that they did. ;-)</p>\r\n<p><strong><span style=\"font-size: 24px;\">Contents</span></strong></p>\r\n<p>This package contains the following Dependency Packs:</p>\r\n<h4>MEGA Prop Packs</h4>\r\n<ol>\r\n<ol>\r\n<li>ks_jpn MEGA Props Vol01</li>\r\n<ul>\r\n<li>21st Century Tower</li>\r\n<li>Al Attar Tower</li>\r\n<li>API World Tower</li>\r\n<li>Ayad Hassan Bin Habshi</li>\r\n<li>Coventry Tower</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol02</li>\r\n<ul>\r\n<li>Bahrain WTC</li>\r\n<li>Infinity Tower</li>\r\n</ul>\r\n<li>ks_jpn\_MEGA Props Vol03</li>\r\n<ul>\r\n<li>Burj Al Arab</li>\r\n<li>Dorra Bay</li>\r\n<li>Dusit Dubai</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol04\_v2 - updated to v2 in Version 2</li>\r\n<ul>\r\n<li>Vienna Tower</li>\r\n<li>Marina Residence</li>\r\n<li>Marina Crown</li>\r\n<li><s>Jade Hotel</s>\_- this model had to be removed as this is a creation of Raika and not a creation of ks_JPN</li>\r\n<li>Fortune Serene</li>\r\n<li>Eliot Tower</li>\r\n</ul>\r\n<li>ks_jpn\_MEGA Props Vol05</li>\r\n<ul>\r\n<li>Wilton Tower</li>\r\n<li>Najd Tower</li>\r\n<li>Millennium Tower</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol06</li>\r\n<ul>\r\n<li>Zayeed Residence</li>\r\n<li>Tower Residence B</li>\r\n<li>Tower Residence</li>\r\n<li>Sompo Japan</li>\r\n</ul>\r\n<li>ks_jpn\_MEGA Props Vol07</li>\r\n<ul>\r\n<li>Chelsea Tower</li>\r\n<li>Shinjuku Mitsui Building</li>\r\n<li>Shinjuku Sumitomo Building</li>\r\n<li>Shiodome Media Tower</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol08</li>\r\n<ul>\r\n<li>Sears Tower</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol09</li>\r\n<ul>\r\n<li>Rosslare Tower</li>\r\n<li>Oceanic Tower</li>\r\n<li>Princess Tower</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol10</li>\r\n<ul>\r\n<li>Shinjuku Nomura Building</li>\r\n<li>Two Prudential Plaza</li>\r\n<li>Toshiba Building</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol11\_v2 - updated to v2 in Version 2</li>\r\n<ul>\r\n<li>Grand Prince Hotel Akasaka</li>\r\n<li>Grand Prince Hotel Akasaka (Christmas Version)</li>\r\n<li>Lighthouse Tower</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol12\_(Stadiums Part 1)</li>\r\n<ul>\r\n<li>Allianz Arena</li>\r\n<li>Osaka Expo '70 Stadium</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol13\_(Stadiums Part 2)</li>\r\n<ul>\r\n<li>Kashima Stadium</li>\r\n<li>Stadion Feyenoord (DeKuip)</li>\r\n</ul>\r\n<li>ks_jpn\_MEGA Props Vol14\_(Stadiums Part 3)\_v2 - updated to v2 in Version 2</li>\r\n<ul>\r\n<li>LTU Arena</li>\r\n<li>Kobe Wing Stadium</li>\r\n<li>Kobe Wing Stadium FIFA Worldcup Version</li>\r\n<li>Yurtec Stadium</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol15</li>\r\n<ul>\r\n<li>Lake City Tower</li>\r\n<li>Worldwide Plaza\_</li>\r\n<li>Tour Montparnasse</li>\r\n<li>Silicon Gates</li>\r\n</ul>\r\n<li>ks_jpn MEGA Props Vol16</li>\r\n<ul>\r\n<li>Arabian Canal</li>\r\n<li>Oasis Park</li>\r\n<li>Palm Square</li>\r\n<li>Bahrein WTC (recovered version)</li>\r\n</ul>\r\n</ol>\r\n</ol>\r\n<p>Various pieces of original documentation and earlier Cleanitol definitions can be found in the \"_Documents\" folder.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/SC4D LEX Legacy - ks_JPN Dependencies Pack V2_SC4E.jpg\" data-lightbox=\"lightbox153\" data-alt=\"lightboxSC4D LEX Legacy - ks_JPN Dependencies Pack V2_SC4E\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/SC4D LEX Legacy - ks_JPN Dependencies Pack V2_SC4E.jpg\" alt=\"SC4D LEX Legacy - ks_JPN Dependencies Pack V2_SC4E\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
