    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This package includes many and varied props (227 props altogether through on three individual prop packs) created by Vnaoned.<br><br>For LOTters, the PROPS are available in Lot Editor, under the names:\_VV_ and VIP_Props_VV<br><br>Xmas lights are timed props (1st december to 15th january).<br>Inflatable pool are timed props (summer / rest of the year).<br>Dead leaves are timed props (autumn).<br><br>Contents as of\_Version 3\_(v3):</p>\r\n<ul>\r\n<li>VIP Vnaoned Propspack vol01 v2 (VIP_Props_VV_Propspack vol01 v2.dat)**</li>\r\n<li>VIP Vnaoned Vehicules v2 (VIP_Props_VV_Vehicules v2.dat)*</li>\r\n<li>VIP Vnaoned Monuments Props v2 (VIP_Props_VV_Monuments v2.dat)**</li>\r\n</ul>\r\n<ul>\r\n<li>VV CarPackVol1 MMP v2 (VV_CarPackVol1_MMP_v2.dat)**</li>\r\n</ul>\r\n<p>Special thanks to <strong>Barbyw &amp; Girafe for packaging and renaming and TSC / VIP members for their suppor</strong>t.</p>\r\n<h3>Change Log</h3>\r\n<p>*Update 2023 - updated to Version 2 (v2).</p>\r\n<div>General\_<em>Project ZIP</em>\_treatment</div>\r\n<div>The pack contains now the\_<strong>VIP_Vnaoned_Vehicules.dat</strong>\_as separate file in the same package.<br><br></div>\r\n<p>**<strong>Update February 2024 - updated to <span style=\"color: #e03e2d;\">Version 3</span> (v3)</strong>.</p>\r\n<div>\r\n<ul>\r\n<li>The pack now contains the\_<strong>VIP_Props_VV_Monuments v2.dat</strong>\_and the\_<strong>VV_CarPackVol1_MMP_v2.dat</strong></li>\r\n<li>Both the\_<strong>VIP_Props_VV_Vehicules v2.dat\_</strong>and the\_<strong>VV_CarPackVol1_MMP_v2.dat </strong>are identical with the same files in the\_<strong><a href=\"https://community.simtropolis.com/files/file/26808-vip-carpack-vol1/\">VIP Girafe-Vnaoned CarPack Vol01-Vol02 v2</a></strong>\_upload.<br>(<em><span style=\"color: #3598db;\">They are taking place in the same folder structure, so when you install both of the prop sets and keep the original folder structure as it is recommended the files will safely overwrite eachother.</span></em>)</li>\r\n<li>The files got renamed to be in line with other VIP contents that got similar treatment.</li>\r\n<li>Small update on the main VV Propspack, which reasulted in the new\_<strong>VIP_Props_VV_Propspack vol01 v2.dat</strong></li>\r\n</ul>\r\n</div>\r\n<p>You will find a\_<em>Cleanitol_VIP Vnaoned Props Pack vol01 v3.txt</em>\_file in the ~Documents that help you remove the unnecessary files.\_It is highly recommended to run the provided cleanitol file for the compilation with one of the following 3rd party cleanitol tools, which can help you remove the old packs or you can remove them manually:<br><br><a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\" target=\"_blank\" rel=\"noopener\">nos.17 Cleanitol</a>\_(new tool)<br><br><a href=\"https://sc4evermore.com/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\" target=\"_blank\" rel=\"noopener\">BSC Cleanitol\_</a>(old tool).</p>\r\n<h3><strong>Large Screenshot</strong></h3>\r\n<p><img src=\"/images/jdownloads/screenshots/Icon_propspack%20vol.%201.jpg\" width=\"1018\" height=\"521\" ></p>\r\n<p><img src=\"/images/jdownloads/screenshots/Icon_VIP_Vnaoned_Vehicules%20v2.jpg\" ></p>\r\n<table style=\"border-collapse: collapse; width: 47.623%; height: 330px;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50.041%;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/jdownloads/screenshots/Icon_Louis_XVI_column_1.jpg\" ></td>\r\n<td style=\"width: 50.041%;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/jdownloads/screenshots/Icon_Luxor_obelisk_1.jpg\" ></td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50.041%;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/jdownloads/screenshots/Icon_royal_fountain_1.jpg\" ></td>\r\n<td style=\"width: 50.041%; text-align: center;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"/images/jdownloads/screenshots/thumbnails/Icon_virgin_fountain_1.jpg\" width=\"250\" height=\"187\" ></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Installation:</h3>\r\n<p><strong>Installation</strong>:\_Copy/extract the\_<strong>VIP\_</strong>parent folder into your Plugins. If you extracted the\_<em>~Documents</em>\_folder as well, it is highly recommended you to keep it for further use/reference, but move it out of the Plugins into a safe location.<br><br><strong>Un-Installing</strong>:\_To un-install the files, simply bulldoze every lot from this download in your cities and delete the files from the plugins folder afterwards.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Icon_propspack_1.jpg\" data-lightbox=\"lightbox188\" data-alt=\"lightboxIcon_propspack_1.jpg|Icon_props_monument_1.jpg|Icon_fountain_Concorde_1.jpg|Icon_propspack vol. 1.jpg|Icon_Louis_XVI_column_1.jpg|Icon_Luxor_obelisk_1.jpg|Icon_VIP_Vnaoned_Vehicules v2.jpg|Icon_royal_fountain_1.jpg|Icon_virgin_fountain_1\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Icon_propspack_1.jpg\" alt=\"Icon_propspack_1\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Icon_props_monument_1.jpg\" data-lightbox=\"lightbox188\" data-alt=\"lightboxIcon_propspack_1.jpg|Icon_props_monument_1.jpg|Icon_fountain_Concorde_1.jpg|Icon_propspack vol. 1.jpg|Icon_Louis_XVI_column_1.jpg|Icon_Luxor_obelisk_1.jpg|Icon_VIP_Vnaoned_Vehicules v2.jpg|Icon_royal_fountain_1.jpg|Icon_virgin_fountain_1\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Icon_props_monument_1.jpg\" alt=\"Icon_props_monument_12\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/Icon_fountain_Concorde_1.jpg\" data-lightbox=\"lightbox188\" data-alt=\"lightboxIcon_propspack_1.jpg|Icon_props_monument_1.jpg|Icon_fountain_Concorde_1.jpg|Icon_propspack vol. 1.jpg|Icon_Louis_XVI_column_1.jpg|Icon_Luxor_obelisk_1.jpg|Icon_VIP_Vnaoned_Vehicules v2.jpg|Icon_royal_fountain_1.jpg|Icon_virgin_fountain_1\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/Icon_fountain_Concorde_1.jpg\" alt=\"Icon_fountain_Concorde_13\" ></a> </span>\r\n        </div> \r\n</body>"
