    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This package holds the models base texture skins for EMD F10 Freight Engines as props.<br><br>It holds 5 different prop series: P1, P2, P3, P4 and P5. Each props series holds models for the following angles:<br>0ยฐ, 11.25ยฐ, 18.43ยฐ, 22.5ยฐ, 26.56ยฐ, 33.69ยฐ, 45ยฐ, 56.31ยฐ, 63.44ยฐ, 67.50ยฐ, 71.57ยฐ, 78.75ยฐ.</p>\r\n<p>For each props series (P1-P5), you will need to install a texture.<br>You can have all 5 be the same, pick a different texture for each one, or some combination in between.<br><br>Textures for the railroads should be installed from the texture packages listed below:<br>VDK Proppack 4 -\_Texture files Vol 4A,\_4B,\_4C\_and\_4D.<br>Each texture packs holds 28 different train color schemes, in totale 112.</p>\r\n<p><span style=\"text-decoration: underline; color: #e03e2d;\"><strong>Please, take some time and read the provided readme files about how to install properly this mod.</strong></span></p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"text_normal\">\r\n<h3 class=\"text_zwischentitel\">Installation:</h3>\r\n<div>The files for this mod are split into a main file and five texture files. The original/initial SC4D LEX upload contained 5 separate uploads, but during the file restoration to SC4Evermore these packages have been combined.</div>\r\n<div><strong>There are two methods to install this package\_(see below).</strong> In both cases you need to copy/extract the\_<strong>BSC\_</strong>parent folder into your\_plugins.</div>\r\n<div><strong><span style=\"color: #e03e2d;\">In any case you must install and keep the BSCPropsVDK EMD F10 Engine Props.dat file.</span></strong>\_You can install textures from\_all four\_packages, but\_<span style=\"text-decoration: underline; color: #e03e2d;\">only one texture</span>\_for each the prop series: P1-P5 will show in game.</div>\r\n<div>\r\n<div>The BSC folder contains a\_<em>BSCProps\_</em>subfolder (with the VDK EMD F10 Engine Props.dat - you must install and keep this) and a\_<em>VDK\_</em>subfolder with the following Prop Pack 4P1 - P5 subfolders for the actual texture variations.\_<span style=\"color: #e03e2d;\"><strong>Bear in mind you can only have ONE texture dat per P# subfolders.</strong></span> The file names contain the designation of the texture variation volumes where they belong, so you can check it in the relevant\_<strong>readme\_</strong>files (VDK EMD F10 Textures Props P1\_<span style=\"color: #e03e2d;\"><strong>Vol04A\_</strong></span>####.dat or VDK EMD F10 Textures Props P1\_<span style=\"color: #e03e2d;\"><strong>Vol04B\_</strong></span>####.dat).</div>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>By fully manual install, after you copied the BSC parent folder\_<strong>you need to go into the Proppack 4 subfolder and choose\_<span style=\"color: #e03e2d;\">ONLY one *.dat</span>\_file from each P# folders!!!</strong> You can have all 5 be the same, pick a different texture for each one, or some combination in between.\_</li>\r\n<li>By using the provided *.exe installers for each texture set volumes that can be found in the ~Documents_INSTALLERS folder. In this case after you copied the BSC folder, go and <span style=\"text-decoration: underline;\">remove </span>the <strong><span style=\"color: #e03e2d;\">Proppack 4 </span></strong>subfolder FROM the VDK folder, then you may run all five installer one by one and choose among the provided options*.<br>It is highly recommended to read the provided <strong style=\"font-size: 1rem;\">readme\_</strong><span style=\"font-size: 1rem;\">files for each set, as it can help choosing between options. <br></span>*Bear in mind at the end\_ you still can only have one DAT per P# files/folders.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n</div>\r\n<br>\r\n<div>The texture files need to be downloaded seperate, one files or all five files.</div>\r\n<div>The files is named\_<i>VDK Proppack 4 - EMD F10 Freight Engines Texture files Vol 4A - 4D.</i></div>\r\n<br>\r\n<div>The file\_<i>VDK EMD F10 Engine Props.dat</i>\_will be installed in the folder:</div>\r\n<div>\"<strong>Simcity 4PluginsBSCBSCProps</strong>\".</div>\r\n<br>\r\n<div>The textures files will be installed in the following folder(s):</div>\r\n<ol>\r\n<ol>\r\n<li>\"<strong>Simcity 4PluginsBSCVDKProppack 4P1 and P2 and P3 and P4 and P5\"</strong> (with manual install - one file per folder)<br><br>OR<br><br></li>\r\n<li>\"<strong style=\"font-size: 1rem;\">Simcity 4PluginsBSCVDKProppack 4\"</strong><span style=\"font-size: 1rem;\">\_(with *.exe installers - five files together, ONE for each P#)</span></li>\r\n</ol>\r\n</ol>\r\n<br><br>\r\n<div>The markings (P1, P2,...) on the grey base textures, indicates for which prop series there are no texture installed:</div>\r\n<div><img src=\"/Images/VDK%20EMD%20F10%20Proppack%20Basetextures.jpg\" alt=\"\" ></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"text_normal\">\r\n<div>\r\n<p class=\"text_zwischentitel\">Uninstallation:</p>\r\nFor uninstalling the files, simply delete the files from the plugins folder.</div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"text_normal\">\r\n<div>\r\n<p class=\"text_zwischentitel\">Known problems:</p>\r\nWhen using custom automata mods the game will occasionally show \"ghost trains\" just after loading<br>(trains showing up just outlined, or only partly visible). This is normal, and nothing to worry about.\r\n<p class=\"text_normal\">In the UDI menu, there will be an icons for each engine mods installed and they will all be that of the replacement mod.</p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h3>Compatibility</h3>\r\n<p>This download is only compatible with SimCity 4 incl. the \"Rush Hour\" expansion pack or SimCity 4 Deluxe.<br><strong>Hint:</strong>\_When using the SimCity 4 Startup Manager, make sure to select the folder:<br>\" BSC\" folder in your region profile(s) before starting the game.</p>\r\n<h3>Credits</h3>\r\n<p>Will like to give thanks to threestooges, Rivit and Eggman121 for their help.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/VDK EMD F10 Props readme.jpg\" data-lightbox=\"lightbox297\" data-alt=\"lightboxVDK EMD F10 Props readme.jpg|BSC VDK Proppack 4 Vol4 A2.jpg|BSC VDK Proppack 4 Vol4 D2\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/VDK EMD F10 Props readme.jpg\" alt=\"VDK EMD F10 Props readme\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/BSC VDK Proppack 4 Vol4 A2.jpg\" data-lightbox=\"lightbox297\" data-alt=\"lightboxVDK EMD F10 Props readme.jpg|BSC VDK Proppack 4 Vol4 A2.jpg|BSC VDK Proppack 4 Vol4 D2\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/BSC VDK Proppack 4 Vol4 A2.jpg\" alt=\"BSC VDK Proppack 4 Vol4 A22\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/BSC VDK Proppack 4 Vol4 D2.jpg\" data-lightbox=\"lightbox297\" data-alt=\"lightboxVDK EMD F10 Props readme.jpg|BSC VDK Proppack 4 Vol4 A2.jpg|BSC VDK Proppack 4 Vol4 D2\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/BSC VDK Proppack 4 Vol4 D2.jpg\" alt=\"BSC VDK Proppack 4 Vol4 D23\" ></a> </span>\r\n        </div> \r\n</body>"
