    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>The SC4D LEX Legacy - BSC Common Dependencies Pack is a unified package with a Java installer, containing over 150 frequently used dependency files produced by the BSC (BATT Squad Certification) Team, including texture and prop packs, as well as the BSC Essentials file.\_ Chances are, if you're looking for a BSC dependency, it's probably in here.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>CHANGELOG</strong></span></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>IMPORTANT NOTE:<br></strong></span><span style=\"text-decoration: line-through;\">The\_<strong>Version 9 update(s)</strong>\_of the BSC Common Dependencies will be a series of smaller updates (before we move to version 10) mostly related to the BSC Essentials and the SimGoober related model packs. </span>These small updates will be noted by the next alphabetical letter in line and a note about the release date. Please keep an eye on the changelog.**</p>\r\n<p>**Version 9b update turned out to be a bit bigger update. Check the ChangeLog, please.</p>\r\n<p><strong>Version 9b update (21 August 2024)</strong></p>\r\n<ul>\r\n<li>The\_<strong>BSC MEGA Props - Rubik3 Vol01 - WTC Props</strong>\_dependency pack has been\_<strong><span style=\"text-decoration: underline; color: #e03e2d;\">REMOVED</span></strong>\_from this compilation as with a recent update it has been moved into its own legacy pack:\_<strong><a href=\"/index.php/downloads/download/20-ploppable/279-sc4d-lex-legacy-bsc-custodian-rubik-wtc-complex\" target=\"_blank\" rel=\"noopener\">SC4D LEX Legacy - BSC Custodian Rubik WTC Complex V2</a></strong></li>\r\n<li>The\_<strong>BSC BATProps Newman Inc RPK Vol01 v2</strong>\_dependency pack has been\_<span style=\"text-decoration: underline;\"><strong><span style=\"color: #e03e2d; text-decoration: underline;\">REMOVED</span></strong></span>\_from this compilation as with recent updates it has been moved into the\_<strong><a href=\"/index.php/downloads/download/14-park/277-sc4d-lex-legacy-bsc-canals-collection\" target=\"_blank\" rel=\"noopener\">SC4D LEX Legacy - BSC Canals Collection V2</a></strong></li>\r\n<li>The brand new\_<strong>BSC MEGA Props Caliban Vol01</strong>\_dependency pack has been added to the compilation, bringing back Caliban's ancient models and props to support up coming re-hosting efforts.</li>\r\n<li>The brand new\_<strong>BSC MEGA Props YDR Vol01</strong>\_dependency pack has been added to the compilation as a preparation for the re-hosting efforts of some of Yoder7652's uploads.</li>\r\n<li>BSC Essentials has received further custom UIs (including the DEDWD_Commercial_commonfiles.dat - released on STEX as a side file of the\_<strong><a href=\"https://community.simtropolis.com/files/file/13153-bsc-mega-props-dae-vol02/\" target=\"_blank\" rel=\"noopener\">BSC MEGA Props DAE Vol02</a></strong>\_download -, which is a collection of custom UIs created by Deadwoods for his Aussie and other commercial shop sets) and now it's running as\_<strong>BSC Essentials\_<span style=\"color: #e03e2d;\">v2024b</span></strong>.</li>\r\n<li>After it was discovered that the former MS Textures file (MikeSeiths custom textures for his dealerships) that was merged into the BSC Textures Vol03 has the wrong ID structure (it used the dummy test ID range from the SC4Tool), this has been fixed andincorporated into the new updated\_<strong>BSC Textures Vol03<span style=\"color: #e03e2d;\">\_v5</span></strong>.</li>\r\n<li>A few new models and props have been added to the second volume of Debussyman's dependency pack which runs now as\_<strong>BSC MEGA Props DBSSYMN Vol02<span style=\"color: #e03e2d;\">\_v3</span></strong>.</li>\r\n<li>A few new props have been added to the first volume of Deadwoods' dependency pack, which runs now as\_<strong>BSC MEGA Props DEDWD Vol01<span style=\"color: #e03e2d;\">\_v4</span></strong>.</li>\r\n<li>From the\_<strong>Grfe_Props_Pack_Carpack vol04.dat</strong>\_an MMP template exemplar has been removed as it does not have any purpose, but was able to cause confusion. There is no version change this time. Just re-install the file from this update.</li>\r\n</ul>\r\n<hr>\r\n<p>As always it is highly recommended to run the cleanitol with the installer and remove any previous versions from your plugins, but also do NOT forget to make back-ups of your plugins folder, just in case.<br>Optionally in the<em>\_~Documents</em>\_folder in the main ZIP you can find the\_all the individual cleanitol files\_and by using either the newer\_<strong><a href=\"https://community.simtropolis.com/files/file/35790-sc4-cleanitol/\" target=\"_blank\" rel=\"noopener\">nos.17's SC4 Cleanitol</a></strong>\_or the older\_<strong><a href=\"/index.php/downloads/download/30-gameplay-utilities/18-bsc-cleanitol\" target=\"_blank\" rel=\"noopener\">BSC Cleanitol</a></strong>\_tool you can search and remove old and outdated versions of these files.</p>\r\n<p>IMPORTANT NOTE:</p>\r\n<p>From Version 9b temporarily the\_<em>Cleanitol_MASTER REMOVE LIST_BSC Common Dependencies Pack Version ##.txt</em>\_has been removed until the LEX Restoration efforts will reach a more advanced state. The individual cleanitol files will be kept available in the meantime, so players have more control what they want to remove, and a new cleanitol script will be added which is aiming to remove the older file versions from previous Common Dependency installs with each updates.\_</p>\r\n<p>Always keep back-ups of your cities and plugins folders before you update from earlier versions or if you start using the BSC Common Dependencies for the first time and you already have old (pre-SC4Evermore) BSC Team related custom contents either from LEX or from other exchanges.\_</p>\r\n<p>If you have issues with the <strong>SimGoober Commercials and Industrials</strong>, please read\_<strong><a title=\"info about the SG Commercial and Industrial Lots\" href=\"https://community.simtropolis.com/forums/topic/763347-simgoober-content-and-bsc-common-dependencies-pack/?tab=comments#comment-1794707\" rel=\"tag\">the following post on Simtropolis</a></strong>. I shared a link there, where I\_<strong><span style=\"color: #e03e2d;\">temporarily\_</span></strong>made the last Project ZIPped LEX versions of the SG Commercials and Industrials available. The officially rehosted version however will get further updates, so those are packs are not the final versions.</p>\r\n<p>What all is in the SC4D LEX Legacy - BSC Common Dependencies Pack?</p>\r\n<p>This package contains the following Dependency Packs:</p>\r\n<h4>Essentials</h4>\r\n<ol>\r\n<li><span style=\"text-decoration: line-through;\">BSC Essentials v2023 - updated in BSC Common Dependencies Version 7.</span> <br><span style=\"color: #2dc26b;\"><strong>BSC Essentials v2024b - updated in BSC Common Dependencies Version 9b</strong></span><br>Please note, this pack will receive further updates and improvements in future releases.</li>\r\n</ol>\r\n<h4>BSC MEGA Prop Packs</h4>\r\n<ol start=\"2\">\r\n<li>BSC MEGA Props ALN Vol01 v2</li>\r\n<li>BSC MEGA Props ALN Vol02</li>\r\n<li>BSC MEGA Props ALN Vol03 v2</li>\r\n<li>BSC MEGA Props CAL Vol01 v2</li>\r\n<li>BSC MEGA Props CARCH Vol01\_v3 - <strong><span style=\"color: #f1c40f;\">updated to v3 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props CARCH Vol02</li>\r\n<li>BSC MEGA Props CARCH Vol03</li>\r\n<li>BSC MEGA Props CARCH Vol04</li>\r\n<li>BSC MEGA Props CARCH Vol05</li>\r\n<li>BSC MEGA Props CARCH Vol06</li>\r\n<li>BSC MEGA Props CARCH Vol07</li>\r\n<li>BSC MEGA Props CARCH Vol08</li>\r\n<li>BSC MEGA Props COBB Vol01</li>\r\n<li>BSC MEGA Props COBB Vol02</li>\r\n<li>BSC MEGA Props COBB Vol03</li>\r\n<li>BSC MEGA Props COBB Vol04</li>\r\n<li>BSC MEGA Props COBB Vol05</li>\r\n<li>BSC MEGA Props COBB Vol06\_- <span style=\"color: #e67e23;\"><strong>ADDED: new pack in BSC Common Dependencies Version 7</strong></span></li>\r\n<li>BSC MEGA Props CP Vol01</li>\r\n<li>BSC MEGA Props CP Vol02</li>\r\n<li>BSC MEGA Props CP Civics\_-\_<strong><span style=\"color: #e67e23;\">ADDED: new pack in\_BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props CP Houses\_-\_<strong><span style=\"color: #e67e23;\">ADDED: new pack in\_BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props CP Industrials\_-\_<strong><span style=\"color: #e67e23;\">ADDED: new pack in\_BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props D66 Vol01\_v3 - <strong><span style=\"color: #f1c40f;\">updated to v3 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_D66 Vol02\_v2 \_- <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_D66 vol03\_-\_<span style=\"color: #e67e23;\"><strong>ADDED: new pack in\_BSC Common Dependencies Version 7</strong></span></li>\r\n<li>BSC MEGA Props\_DAE Vol01\_v3 - updated to v3 in BSC Common Dependencies Version 7<br><strong><span style=\"color: #2dc26b;\">BSC MEGA Props DAE Vol01 v4 - updated to v4 in BSC Common Dependencies Version 9b</span></strong></li>\r\n<li>BSC MEGA Props\_DAE Vol02<strong><span style=\"color: #f1c40f;\">\_-\_ADDED: new pack in\_BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props DBSSYMN Vol01\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li><span style=\"text-decoration: line-through;\">BSC MEGA Props DBSSYMN Vol02\_v2 - updated to v2 in BSC Common Dependencies Version 7</span><br><strong><span style=\"color: #2dc26b;\">BSC MEGA Props DBSSYMN Vol02 v3 - updated to v3 in BSC Common Dependencies Version 9b</span></strong></li>\r\n<li>BSC MEGA Props\_Gascooker Vol01\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_Gascooker Vol02 v2</li>\r\n<li>BSC MEGA Props GAZ Vol01\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_JBSimio vol01\_v2 - <strong><span style=\"color: #f1c40f;\">u<strong>p</strong>dated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_JBSimio vol02\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_JBSimio vol03\_v2 - <strong><span style=\"color: #3598db;\">updated to v2 in BSC Common Dependencies Version 5</span></strong></li>\r\n<li>BSC MEGA Props Jen_P Vol01\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li><span style=\"text-decoration: line-through;\">BSC MEGA Props\_JENX Vol01\_v2 - updated to v2 in BSC Common Dependencies Version 7</span><br><span style=\"text-decoration: line-through;\">BSC MEGA Props JENX Vol01 v3 - updated to v3 in BSC Common Dependencies Version 8<strong><span style=\"color: #843fa1; text-decoration: line-through;\"><br></span></strong></span><span style=\"color: #2dc26b;\"><strong>BSC MEGA Props JENX Vol01 v4 - updated to v4 in BSC Common Dependencies Version 9a</strong></span><span style=\"text-decoration: line-through;\"><strong><span style=\"color: #843fa1; text-decoration: line-through;\"><br></span></strong></span></li>\r\n<li>BSC MEGA Props\_JENX Vol02 - PARIS\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_JENX Vol03\_v2 - <strong><span style=\"color: #f1c40f;\">updated to v2 in BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props\_JENX Vol04\_-\_<strong><span style=\"color: #e67e23;\">ADDED: new pack in\_BSC Common Dependencies Version 7</span></strong></li>\r\n<li>BSC MEGA Props JENX Vol05 - Medie