    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This package contains a number of textures and HD rendered props for making Tennis scenes in the Lot Editor*.<br><br>There are textures and props to make tennis courts in Straight, Diagonal and Fractionally Angled (22.5ยฐ &amp; -22.5ยฐ) rotations. Additionally there are props for Tennis Nets, Court Fencing and a few extras that may come in handy when lotting. Prop families have also been used for the Court and Fencing props, which will randomly select one of the available colours/styles.</p>\r\n<p>It should be noted that this is a Dependency, as such you will not find any new lots as a result of installing this file.</p>\r\n<p>Huge thanks to KingOfSimCity for providing the inspiration for this pack and the included textures. Also for collaborating with me on the props development.<br><br><em>\_ \_ *Strawberries and Cream not included.</em></p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/AoT_1.jpg\" data-lightbox=\"lightbox88\" data-alt=\"lightboxAoT_1\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/AoT_1.jpg\" alt=\"AoT_1\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
