    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This package contains props which show banners with retail logos.<br><br>The basic idea is that the props are in a family. That way when the family is used on a lot, one will be randomly selected from the installed props.</p>\r\n<p>Currently I'm really just testing out the concept. But to get things going, I've made almost 30 banners/props, grouped by 6 countries:</p>\r\n<ul>\r\n<li>AUS - Australia</li>\r\n<li>DE - Germany\_</li>\r\n<li>JPN - Japan</li>\r\n<li>RUS - Russia</li>\r\n<li>UK - United Kingdom</li>\r\n<li>US - United States</li>\r\n</ul>\r\n<p>Each pack contains between 3 and 6 props, for stores of those countries. Here's the neat part...<br><br>You can choose to install only one region, selected regions or even all of them, it's totally up to you. But whichever you install will dictate which stores appear on lots using the props. For now these will support my Convenience Store lots, watch out for those in the coming days. But perhaps there is room to expand on the concept in future.<br><br>One last bonus. I've included some basic resources, 3D Modelling application files, sample texture. Readme for anyone who wants to have a go making their own compatible props. There are two files, one .max for 3DS Max users (made with 2011). Along with .3DS which can be imported into SC4BAT, see the included documentation for more info.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/large_RSP.jpg\" data-lightbox=\"lightbox91\" data-alt=\"lightboxlarge_RSP.jpg|small_RSP\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/large_RSP.jpg\" alt=\"large_RSP\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/small_RSP.jpg\" data-lightbox=\"lightbox91\" data-alt=\"lightboxlarge_RSP.jpg|small_RSP\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/small_RSP.jpg\" alt=\"small_RSP2\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
